import React, { Component } from 'react';

import defaultImgMap from '../assets/images/none.png';

class Map extends Component {
	render() {
		return(
			<div className="map-box">
				<img src={defaultImgMap} alt=""/>
			</div>
		);
	}
}

export default Map;
